INSERT INTO `webpage` VALUES ('com.romantic214.chs:http/26zimu-aidefangshi/', , '26个字母都各有一个浪漫爱的方式 | 浪漫网 浪漫网 首页 免费创意区 创意库 浪漫创意 新创意诞生区 浪漫场景布置 爱情短片 浪漫道具 浪漫图片 浪漫场景图片 浪漫灵感图片 求婚创意 浪漫礼物 怎么浪漫 最浪漫的话 浪漫感人求婚词 简单浪漫小点子 40个心形折纸大全视频教程 升级会员 站务区 黑板报 联系我们 登录 最新消息： 浪漫网为你提供完整浪漫实施方案，5年精心运营，超过3000个易用性强的浪漫方案供你参考。 你的位置： 浪漫网 > 浪漫创意 > 26个字母都各有一个浪漫爱的方式 26个字母都各有一个浪漫爱的方式 浪漫创意 Firewings 21111浏览 1评论 你知道吗，其实26个英文字母，每个字母都有一个浪漫爱的方式，看下面的图吧。我会逐一介绍的。 现在想到的一个浪漫创意是，准备一个大信封，上面写着“26个字母，26个爱你的方式”，把这些图片打印成明信片，装进信封里面，然后当送给她。 下面的图片全部是高清大图，大家下载后就可以直接打印了。 感觉是个非常好的浪漫创意，于是灵感闪现，想出了两套非常棒的浪漫计划。 第一套为求婚： 按照26个英语字母的明星片的方法，我们把 M 字母那张抽出来，然后重新弄张明星片，上面写着“数数这里有多少个字母，是不是少个字母呢，现在打开门，它就在外面”。 然后把上面的26张放进信封里面，藏在一个简单易找，却不会被一眼看到的地方。然后等她在家的时候 （ 这时你在邻居家潜伏 ）， 打个电话告诉她今天收到一封信，是寄给她的（一定要选择晚上哦，因为后面我们要摆 蜡烛阵 ！ ），然后引导她找到，一定要确定她找到才挂电话。 准备工作： 打电话前让朋友帮忙把蜡烛阵摆好，摆成Marry me，我这里摆楼梯过道里吧。要把过道灯给关掉，不让它亮着影响蜡烛阵效果。 你打完电话就可以在外面把蜡烛全部点亮了，她拿出信封会一张一张看，当她看完最后一张之后，一打开门，就看到门口摆着Merry me 字样的蜡烛阵，然后你拿出戒指和鲜花开始求婚，并告诉她缺的最后个字母就在这里。她一定会被感动的，面对如此精心策划的浪漫求婚，是否会答应嫁给你，那要看你平时所作的努力了。 第二套为生日： 这次把 H 字母那张抽出来，然后重新弄张明星片，上面写着“数数这里有多少个字母，是不是少个字母呢，现在关掉所有灯，它就会出现”。 当两个人都在家的时候，你假装去洗澡，其实早已经把写着Happy birthday的蛋糕藏浴室了，你在浴室告诉她有封信是给她的。 当她看完最后一张的时候，会按照明信片上说的把灯关掉，这时你在浴室应该可以看到外面关掉灯了，这时你把点亮蜡烛的生日蛋糕端出去，还唱着生日快乐歌。唱完告诉她，这个就是缺失的字母H。Happy birthday，亲爱的。 第三套为表白： 这次把字母 U 那张抽出来，跟以上策划一样，不过 U 这个字母的读音可是 You。你可以告诉她，里面缺了一个字母，请问是哪个字母呢？等她数出来的时候，你就说：“对呀，就缺 You ，这26个字母的表白就完整了”。（边说边从一侧拉起她的手） 既然你都提到了表白，她肯定知道你要干什么了。这时注视着她的眼睛，问她是否做你女朋友吧。 未经许可谢绝转载： 浪漫网 » 26个字母都各有一个浪漫爱的方式 继续浏览有关 创意表白 妹纸可用 室内 小浪漫 生日惊喜 的文章 分享此文到： 更多 上一篇 学做咖啡厅创意示爱浪漫创意 超大情书你见过么 下一篇 与本文相关的文章 一个跟键盘有关的浪漫小点子 突破限制完成国庆期间异地恋生日惊喜 第一次这么有才，今年送老婆的生日惊喜 学做咖啡厅创意示爱浪漫创意 用冰淇淋制造给女朋友的小惊喜 浪漫的情侣手机壁纸点子 用狗狗追女孩的浪漫方法 学《东京爱情故事》送个雪人给她吧 在天台浪漫烛光晚餐的经典案例 本年度最屌给老婆的生日祝福 文字心形图案详细设计教程 七夕节送给老婆的创意水果拼盘 用盘子送上求婚戒指的点子 哇偶，很浪漫的iPhone手机表白短信 七夕我就是用这招感动我男朋友的 最快速纸巾折玫瑰花图解+魔术教程 快速导航 求婚视频 (80) 创意表白 (77) 妹纸可用 (68) 小浪漫 (61) 生日惊喜 (57) 最浪漫 (55) 手工礼物 (55) 夜晚 (46) 情人节创意 (44) 室内 (43) 鲜花 (25) 异地恋怎么制造惊喜 (23) 结婚纪念日 (19) 气球布置 (19) 用餐 (18) 送戒指 (14) 韩国求婚 (12) 烟花 (7) 关注浪漫网 　　　　　  关注全球浪漫惊喜 最新讨论 Max 13小时前说： 天呐 lydiaa 18小时前说： 请问怎么